import { Canvas } from "@react-three/fiber";
import { OrbitControls } from "@react-three/drei";

export default function Plane() {
   return (
      <Canvas>
         <ambientLight />
         <mesh>
            <planeBufferGeometry attach="geometry" args={[25, 15]} />
            <meshPhongMaterial attach="material" color="green" />
         </mesh>
      </Canvas>
   );
}
